import React, { Component } from "react";

class imageGallery extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        <div class="row">
          <div class="col-md">
            <div class="thumbnail">
              <a href="/w3images/lights.jpg">
                <img
                  src="/w3images/lights.jpg"
                  alt="Lights"
                  style="width:100%"
                />
              </a>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default imageGallery;
